echo "Stripping invalid archs '${ITEM}'"
lipo -remove i386 "${ITEM}" -o "${ITEM}"
echo "Signing '${ITEM}'"
codesign --force --verbose --sign "${CODE_SIGN_IDENTITY_FOR_ITEMS}" --entitlements "${CODE_SIGN_ENTITLEMENTS}" "${ITEM}"
